INSERT INTO `answer` VALUES (1,1,2,'Yes, I\'ve found LinkedIn and SBJ to be the best source for sports business news. Twitter for quick updates and general business insight.',1,'2017-08-17 17:55:48','2017-08-17 19:19:26',NULL),(2,1,3,'Thanks Mark! The goal is to continue adding resources to train more people in person, via the phone, and virtually. We have a passion to help others succeed and we\'re on a quest to reach, engage with, and help as many sports business professionals as we can. Thanks for reaching out.',1,'2017-09-11 12:30:44','2017-09-11 12:30:44',NULL),(3,1,4,'Ganar, a sports MBA is a great option if you\'re serious about a career in sports. UCF (central Florida), USF (south Florida), ASU, OhioU and UMASS all have great programs and would be worth exploring. Good luck!',1,'2017-09-22 11:56:13','2017-09-22 11:56:13',NULL),(4,1,5,'Brent- Thanks for reaching out! It\'s a good question. In short, I don\'t think it hurts. I\'ve heard stories of people mailing letters and emailing senior leaders at teams and then later hearing that it worked, or the executive forwarded the note to HR and it led to an interview. You\'d be surprised, they don\'t get as much of that as you may think. So I do think it can help you. My general philosophy on this is to be proactive and diversify your outreach. Don\'t just apply for a job and then wait for a call. \r\n\r\nLook for the type of job(s) that interest(s) you most and then try and make contact with that specific hiring manager. Call, email and LinkedIN are all good channels to use. Aim to introduce yourself and to learn more about the job. The squeaky wheel often times gets the grease on these. Not everyone will respond but if they see your application come through the website, then they see you on email and/or social media, and possibly on the phone it demonstrates your commitment to the opportunity and It\'ll help you\'ll stand out. For me, those people always got noticed and it often times led to a phone interview. However, delay your touch-points a bit, and don\'t overdo it. There is a fine line. Hope that helps and good luck!',1,'2017-11-06 13:43:24','2017-11-06 13:43:24',NULL),(5,7,5,'Brent - I agree with a lot of what Bob said.  I remember when I first started working in sales at IOMEDIA, I e-mailed a team president to try and get a meeting with the organization and he replied and CCed the VP of Ticket Sales to make sure he talks to me.  Sometimes the higher level executives appreciate you taking a risk and trying to be bold.  \r\n\r\nI\'d also add another idea that I used to use when applying for jobs back in the day.  Try to find a connection at the organization through either a mutual contact or maybe someone at the team that went to the same college as you.  You\'re always going to get a more warm response when an intro comes from a friend or you went to the same school.',1,'2017-11-06 14:57:24','2017-11-06 14:57:24',NULL),(6,7,4,'Don\'t forget about my boys up in Syracuse too!  A rather new but really impressive sports management school.',1,'2017-11-06 14:58:17','2017-11-06 14:58:17',NULL),(7,204,5,'I have a follow up question. \r\n\r\nWhen mentioned above about reaching out to an executive, what is the best method? Call me old school, but I believe a written out signed letter means more than an email or message. If I have a connection on LinkedIn, would that be a good route to go if I don’t have an email address for any executives?\r\n\r\nThanks!',1,'2017-11-06 15:47:21','2017-11-06 15:47:21',NULL),(8,1,5,'Brent, I like the handwritten note. Agree it\'s a bit more personal than email. I think both LinkedIn and Email can work, maybe try both and space out the two. If you do enough research you can just about always find an email address. Keep the message short and sweet though. Aim to make it educational, come prepared with questions, ask for the next step(s) and follow up accordingly. Hope that helps!',1,'2017-11-08 16:06:58','2017-11-08 16:06:58',NULL);
