INSERT INTO `job` VALUES (1,1,'Account Executive, Corporate Hospitality & Group Sales Retention','Corporate Hospitality and Group Sales Retention Account Executives will be responsible for developing relationships with all of our group and hospitality accounts and growing these accounts year-over-year.  AE’s will be tasked with overseeing a large book of business and maximizing opportunities with all group accounts.  Also, AE’s will be responsible for new business development initiatives and will have ability to sell a full menu of Mets ticket offerings (seasons, suites and groups).','2017-08-18 08:38:25','2017-09-11 11:53:19','New York Mets',NULL,NULL,'New York','NY',0,'job/SfRDCIkbCfvhchln0GBW4PPLCNKXreGTvtWN7eeZ.png','2017-09-11 11:53:19','document/jNazWXCczf61G7QjuFNiPdhhWjLAAwdYBqZxdwFp.pdf',0,0),(2,1,'Account Executive, Corporate Hospitality & Group Sales','Corporate Hospitality and Group Sales Account Executives sell a comprehensive array of New York Mets ticket-related products with a strong emphasis on group tickets, hospitality packages and suite rentals. All staff have the ability to sell full menu and will have season ticket related goals as well. Strong emphasis will be placed on new business development through face-to-face meetings at the ballpark and out of office. Ideal candidate must be detail oriented and organized with the ability to effectively communicate with a wide range of clientele.','2017-08-18 08:41:55','2017-09-26 15:33:50','New York Mets',NULL,NULL,'New York','NY',0,'job/pskPguMeNEI7qghfEWGJfsyp0HlannV6Yg7lslDb.png','2017-09-26 15:33:50','document/BGFkGmRaeyZBk0nQbM0j4GG1HIv1gV8KzZWQ4y8V.pdf',0,0),(3,1,'Vice President, Sales','The Vice President of Sales for the Norfolk Admirals (ECHL) will ultimately be responsible for overseeing all company revenues. This individual will oversee all ticket sales as well as all sponsorship sales. They\'ll be tasked with creating the strategy and game-plan, along with hiring, on-boarding, training, and executing the sales campaign(s) across all company product types. The role will report directly to the team president.','2017-08-24 13:09:51','2017-09-15 16:47:43','Norfolk Admirals',NULL,NULL,'Norfolk','VA',0,'job/KHL5RQtixfVC78JlKwk2cmdcxgnWf6fh7p1jf4QO.jpeg','2017-09-15 16:47:43','document/W8VHqcTQSVGzTglyj8kc68WtfezIfgwmEVmLFYO8.pdf',0,0),(4,1,'Intern','Eventia Sports & Entertainment Group specializes in event management, athlete and celebrity bookings, brand sponsorship activation and building new partnerships. Our company focuses on the crossover between sports, entertainment, lifestyle and sports business. We’re looking for someone who’s very ambitious and interested in the sports and entertainment business. Because we have business interests in multiple areas, our ideal candidate is someone who’s also interested in the multi-faceted nature of the sports and entertainment business. Our company is aggressively expanding its events, marketing and sports business portfolio, and we’re looking for interns who can help us with lead identification, outreach and social media.','2017-08-25 15:55:10','2017-09-26 15:33:43','Eventia Sports & Entertainment Group',NULL,NULL,'Work from home','NV',0,'job/4SxBlIDt3BBtlXEULmovVWikgtfDl8aG8WlOPOQr.png','2017-09-26 15:33:43','document/M4IbG0zfoz4SuxS2E7aGxEkqxscJrQkz5fIQdy4Z.pdf',0,0),(5,1,'Intern, Research & Social Media','Sports Business Solutions is a boutique sports consulting firm based in Phoenix, AZ. They specialize in training, consulting, and recruiting for sports teams and career coaching for job seekers. Launched in 2014, the mission of SBS is to help people achieve success in sports business.   This Research & Social Media internship is designed to be a true learning experience by providing the intern firsthand sports industry experience dealing with industry personnel and professional teams and brands. The internship is unpaid, but offers, the ability to work remotely, flexible hours, and a unique learning experience in the sports industry. Time commitment is not expected to exceed 20 hours per week. *Must be eligible to receive school credit to qualify* This position will be responsible for assisting with the management of Sports Business Solutions’ social media accounts and coordinating content delivery to increase client and prospective client engagement.','2017-08-25 16:22:28','2017-09-26 15:33:38','Sports Business Solutions, LLC',NULL,NULL,'Work from home','AZ',0,'job/FBpMrpJA0EmiYuISUXPTvbOHzcFrt6dAhRnECQ6F.png','2017-09-26 15:33:38','document/2Est5bfTyK7qlvJmykGvuYD71XUxS1y27UYu2QuV.pdf',0,0),(6,1,'Sr. Manager - Database Analytics & CRM','This role is responsible for the development, implementation and maintenance of the New York Jets’ Database and CRM functions. The primary focus of the role is to acquire, analyze, prioritize, and deliver leads to our sales teams. Problem solving and critical thinking will be key success factors for delivering unique and actionable insights based on our growing knowledge of the fan.','2017-08-28 10:44:40','2017-09-26 15:33:34','New York Jets (NFL)','nfl','data-analytics','New York','NY',0,'job/X6lOFdFOufEFueRb9fipVFgw6Kh6baTItVu222ba.png','2017-09-26 15:33:34','document/1EfBesaIFRRPXglAbnLwqAyuwkWIip7kVw0iDHky.pdf',0,0),(7,1,'Sr. Manager, Partnership Sales - Brooklyn Nets (BSE)','The Senior Manager, Partnership Sales will be responsible for prospecting, pursuing, and developing new sponsorship partnerships for the Brooklyn Nets, Barclays Center and other affiliated properties. The incumbent must possess great energy, a strong sales background, and excellent communication skills. This position reports directly to the Vice President of Partnership Sales. Brooklyn Nets, LLC is an Equal Opportunity Employer (EOE).','2017-08-28 10:53:11','2017-11-03 11:03:18','Brooklyn Nets (BSE)','nba','sponsorship-sales','Brooklyn','NY',0,'job/MW8cZ39FET0NqV8eolmu73pCBT4Lr3OxATto23kL.jpeg','2017-11-03 11:03:18','document/W4oxbLJYYFIXJEIXpKamo6OYFQpWZZEWOMfpEKZF.pdf',0,0),(8,1,'Account Executive, Group Ticket Sales','This position is responsible for generating new group ticket sales for the Denver Nuggets. The individual will prospect for new business, make sales calls, set new business appointments and be tasked with both selling new groups and retaining past group ticket buyers. This is a sales position and the individual will be held to a sales goal/quota and is responsible for achieving the set revenue number as well as exceeding the basic sales activity metrics. Past sports sales experience is preferred with a working knowledge of group sales.','2017-09-11 12:17:01','2017-10-20 07:09:32','Denver Nuggets (NBA)',NULL,NULL,'Denver','CO',0,'job/8/medium-Denver-Nuggets-(NBA)-Sports-Business-Solutions.png','2017-10-20 07:09:32','document/5XkZO7h6YdD9Kj4bbjCVMsmgHMX0DDfBwzn8Ikp7.pdf',0,0),(9,1,'Account Executive, Fan Development','This position will report directly to the Manager of Fan Development. The position is responsible for maximizing revenue for the Ticket Sales Department through the proactive, outbound sales of season tickets, group tickets, and suites. This is a full time position that exposes you to the business of sports, gives unprecedented access to high-level executives within the A’s, and offers the potential for career growth. The position also participates in special projects, as assigned, to support departmental objectives and offers a rare opportunity to grow your professional sports sales career in an exciting and supportive training environment.','2017-09-11 12:23:12','2017-10-23 10:50:45','Oakland Athletics (MLB)','mlb','administrative','Oakland','CA',1,'job/9/medium-Oakland-Athletics-(MLB)-Sports-Business-Solutions.png','2017-10-23 10:50:45','document/OI6FSYK91v9wegP8zPl9h8tpltwNtbSPwjt4v4Jf.pdf',0,0),(10,1,'Account Executive, Season Ticket Sales','The key responsibility of the season ticket account executive is to sell season tickets and partial ticket plans to families, fans, and business pro