ughout the sports industry.','2017-09-27 16:38:43','2017-11-20 15:07:57','Phoenix Suns, Mercury, Talking Stick Resort Arena','nba','administrative','Phoenix','AZ',0,'job/18/medium-Phoenix-Suns,-Mercury,-Talking-Stick-Resort-Arena-Sports-Business-Solutions.jpeg','2017-11-20 15:07:57','document/9oe3tlA4wyLoRv7ovEmmaemfksOKo8Md3gAGRC97.pdf',0,0),(19,1,'Account Executive, Group Sales','Primary focus is on selling group tickets and VIP Packages for a wide variety of events and attractions:  Premier Sports Teams: Phoenix Suns (NBA), Phoenix Mercury (WNBA), and Arizona Rattlers (IFL)  Family Shows (Disney on Ice, Marvel, Supercross, Monster Jam, etc.) Group Sales Account Executives plan and coordinate large group events and theme nights, directed at generating ticket revenue. The selected candidate will make outgoing calls; set/attend sales-based appointments and presentations, in addition to working sales events and games. Account Executives will perform basic office functions as needed, and be challenged to create new ideas to increase sales.','2017-09-27 16:47:03','2017-11-20 15:08:02','Phoenix Suns, Mercury, Talking Stick Resort Arena','nba','administrative','Phoenix','AZ',0,'job/19/medium-Phoenix-Suns,-Mercury,-Talking-Stick-Resort-Arena-Sports-Business-Solutions.jpeg','2017-11-20 15:08:02','document/s7ureriRvSLOOUCkJkMRL1zQ6vbi3pwCXYi7eahy.pdf',0,0),(20,1,'Business Development Representative','The Business Development Department has been created to maximize revenue on products throughout the Wrigleyville campus owned by the Ricketts Family. These products include the Chicago Cubs/Wrigley Field, Rooftops, and new meeting and event space being created in the office and hotel complex adjacent to Wrigley Field. This position engages participants in programming and training designed to build the critical skills that are required to succeed in the next level of professional sports sales.','2017-10-03 15:44:44','2017-11-20 15:07:52','Chicago Cubs - Marquee Sports & Entert