er in the sports industry and prepare you with the skills to take the next step into our senior level ticket sales positions. \r\n\r\nIn addition to working for a world-class organization, we offer a bi-weekly salary, generous commissions, free parking in Downtown Cleveland, health insurance, and a positive and professional work environment!','2017-10-27 09:25:52','2017-10-27 09:25:53','Cleveland Cavaliers','nba','ticket-sales','Cleveland','OH',1,'job/32/medium-Cleveland-Cavaliers-Sports-Business-Solutions.png',NULL,'document/AnN9XpbzbetNRkagfZb1Vbm5ZOGpxolAaEzwAWKL.pdf',0,0),(33,13,'Manager, Business Intelligence','This position serves the Dallas Stars Marketing division by providing relevant intelligence for all fan-facing and/or revenue generation initiatives undertaken within the scope of sales and marketing.  The goal for this position is to elevate Dallas Stars’ ability to monitor, report and act on available information to ensure the organization is keeping pace with NHL peers in the area of business analysis.','2017-10-31 06:26:24','2017-10-31 06:26:24','Dallas Stars (NHL)','nhl','data-analytics','Dallas','TX',1,'job/33/medium-Dallas-Stars-(NHL)-Sports-Business-Solutions.png',NULL,'document/9dzQI0GLDCpE2KjqP4PuiVexUVvzeFjCKjtnkvZD.pdf',0,0),(34,13,'Client Service Specialist','The Client Service Specialist is directly responsible for all revenue goals associated with an assigned account base of existing season ticket holders, focusing on renewals and retention, referrals, add-ons and upgrades. A Client Service Specialist will focus on creating relationships with assigned account base by being pro-active to anticipate client needs.','2017-11-03 08:52:36','2017-11-03 11:04:03','Florida Panthers (NHL)','nhl','ticket-sales','Miami','FL',1,'job/34/medium-Florida-Panthers-(NHL)-Sports-Business-Solutions.png','2017-11-03 11:04:03','document/6NiZnd4lgxS8sQTzU8vI00S9Zgg0XQo5VLkEE39g.pdf',1,4),(35,13,'Manager, Global Partnerships','Manager, Global Partnership Sales will be responsible for prospecting, pursuing, and developing new sponsorship partnerships for the Brooklyn Nets, Barclays Center and other affiliated properties.  The incumbent must possess great energy, a strong sales background, and excellent communication skills.','2017-11-03 08:58:36','2017-11-03 11:12:26','Brooklyn Sports & Entertainment','nba','sponsorship-sales','Brooklyn','NY',1,'job/35/medium-Brooklyn-Sports-&-Entertainment-Sports-Business-Solutions.jpeg','2017-11-03 11:12:26','document/MxqxBUBsnC21P9bPrdGilRPh7LAwyGgWRO9NCRp6.pdf',1,1),(36,13,'Ticket Sales Representative','The Tampa Bay Rays are seeking a candidate for a Ticket Sales Representative to sell ticket packs, season ticket plans, group tickets and suites for the upcoming 2018 MLB season.  This positions will be responsible for selling a variety of ticket options from single game tickets to ticket plans over the phone or in person through appointments at Tropicana Field.  You will be expected to provide exemplary customer service for any ticket related issues or questions, along with representing the Ticket Sales department at various promotional events and in-game sales tables.','2017-11-03 10:59:25','2017-11-06 12:58:22','Tampa Bay Rays (MLB)','mlb','ticket-sales','St. Petersburg','FL',1,'job/36/medium-Tampa-Bay-Rays-(MLB)-Sports-Business-Solutions.png','2017-11-06 12:58:22','document/kg542rvG6g5ymNnJrb4jXRn7Y4tOMQvOJUy4pbe5.pdf',0,0),(37,13,'Manager, Premium Seating','The San Jose Earthquakes are seeking a Manager, Premium Seating Relations who can provide first- class customer service in all aspects of the job and develop excellent relationships with Club Seat and Suite holders.  This person will be responsible for identifying new areas of growth opportunities for the Earthquakes organization, and deliver customized communications, events, programs and benefits to the team\'s most important fans.','2017-11-06 11:41:59','2017-11-20 15:05:20','SJ Earthquakes (MLS)','mls','ticket-sales','San Jose','CA',0,'job/37/medium-SJ-Earthquakes-(MLS)-Sports-Business-Solutions.png','2017-11-20 15:05:20','document/2TUKGEdZKrtbnjQCMNkmKbfqOJ8bBcIlfTn870PD.pdf',0,0),(38,7,'Account Executive, Ticket Sales','The Account Executive position is an incredible opportunity to start a sales career in the sports industry with an organization committed to professional growth and career development.  Account Executives will receive 2 weeks of the industry’s best sales training and on-boarding program to help prepare them for success.\r\n\r\nAccount Executives experience every aspect of the ticket sales operation in addition to a 360 degree view of the organization, while developing the skill set needed to succeed in the sports industry through recurring sales and product training. Account Executives may be placed into a fast-track mentor team with a focus on Season Tickets, Group Tickets or Season Ticket Services. This is an opportunity to join a team thriving as the league leaders in new full season tickets sold, increased attendance and much more with continued aggressive growth goals leading into a new arena.\r\n\r\nThe primary responsibility of the Account Executive, Ticket Sales is to build relationships with potential prospects to sell new season ticket memberships, mini-plans and group tickets. Account Executives will have the opportunity to utilize the new multi-million dollar downtown Experience Center when hosting prospects at VIP events and Tours.','2017-11-07 09:06:08','2017-11-07 09:11:15','Sacramento Kings','nba','ticket-sales','Sacramento','CA',1,'job/38/medium-Sacramento-Kings-Sports-Business-Solutions.png','2017-11-07 09:11:15','document/EgJFu5cfRJdiwKn4oJKPUQ8DWsKERMsetCjcyOno.pdf',0,0),(39,13,'Account Representative','The Account Representative is responsible for the sale of new season ticket memberships, group accounts, mini plans, and premium seating. This is accomplished by phone, email marketing, face-to-face presentations, in-arena tours, and out-of-office appointments. In this role, you will be tasked with generating and implementing new and creative ideas to increase ticket sales revenues. You will also be responsible for an individual quota, and have the opportunity to learn in a world class environment amongst a team of top performers. The goal of this position is to offer approximately 12 months of training and development.','2017-11-27 07:25:52','2017-11-27 07:25:52','Tampa Bay Sports & Entertainment (NHL)','nhl','ticket-sales','Tampa','FL',1,'job/39/medium-Tampa-Bay-Sports-&-Entertainment-(NHL)-Sports-Business-Solutions.png',NULL,'document/RuchLtWlKQdeDBGfaZ2xzQdpTJ5tfhBA9XDRcYRr.pdf',0,0);
