INSERT INTO `question` VALUES (2,7,'Preferred Sports Biz Info Location',1,'2017-08-17 13:41:16','2017-08-17 17:54:31','Where do you get most of your sports business information? Twitter, LinkedIn, Sports Business Journal, another website?','2017-08-17 13:41:54'),(3,49,'Training & Technology',1,'2017-08-31 13:54:55','2017-09-11 11:51:29','First and foremost, fantastic info on your site. With the rapid advancement of technology and the need for continuous and on-demand training, what do the next 3-5 years look like for SBS?',NULL),(4,80,'Can I pursue MBA in sports administration?',1,'2017-09-17 03:49:46','2017-09-22 11:53:12','I am inclined to have a career in sports. I have just graduated and I am curious to know if there is a relevant course that offeres post graduation in sports administration.','2017-09-17 03:52:09'),(5,204,'Unconventional Introduction to an Organization',1,'2017-11-06 13:01:07','2017-11-06 13:32:41','Hello,\r\n\r\nFirst off, I would like to preface that having a career within a professional sports organization would be my dream job, I have a question on what the best way is to kick off a conversation. \r\n\r\nI often have tossed around the idea of crafting a letter of employment interest addressed to the GM/President or owner of a club. Do you suggest that is a good way to get noticed within an organization? Part of me thinks yes because it shows desire and persistence, however I can see how someone in that position would want nothing to do with a prospective employment letter from a random person. \r\n\r\nThanks!',NULL);
